  true,\n\t\"url\": null,\n\t\"notes\": \"School District Finance Survey, 2008-09
  (F-33 2008-09), is a study that is part of the Common Core of Data (CCD) program;
  program data available since 1990 at <http://nces.ed.gov/ccd/f33agency.asp>. F-33
  2008-09 (http://nces.ed.gov/ccd/f33ageninfo.asp) is a universe survey that is designed
  to provide finance data for all local education agencies (LEAs) that provide free
  public elementary and secondary education in the United States. The data file for
  F-33 2008-09 contains 16,563 records representing the public elementary and secondary
  education agencies in the 50 United States and the District of Columbia. Key statistics
  produced from F-33 2008-09 are expenditures by object and function, indebtedness,
  and revenues by source. The F-33 is collaboration by the National Center for Education
  Statistics (NCES) and the Census Bureau. Census is the primary collection agent.
  Census refers to the collection as ufffdthe Annual Survey of Local Government Finances:
  School Systems and releases its own version of the data file and publication based
  on that file. The NCES and Census files differ in their inclusion of independent
  charter school districts, the classification of some revenue items, and the inclusion
  of some expenditure items.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
